946","exception":false,"start_time":"2022-03-08T01:36:28.636389","status":"completed"},"tags":[]},"source":["* #### **Correlation test between Active Minutes and Calories burned:**"]},{"cell_type":"code","execution_count":15,"id":"9d47c545","metadata":{"execution":{"iopub.execute_input":"2022-03-08T01:36:29.893501Z","iopub.status.busy":"2022-03-08T01:36:29.892869Z","iopub.status.idle":"2022-03-08T01:36:29.925151Z","shell.execute_reply":"2022-03-08T01:36:29.923772Z"},"papermill":{"duration":0.458767,"end_time":"2022-03-08T01:36:29.925306","exception":false,"start_time":"2022-03-08T01:36:29.466539","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$SedentaryMinutes\n","t = -3.2951, df = 938, p-value = 0.001021\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," -0.16975380 -0.04332754\n","sample estimates:\n","      cor \n","-0.106973 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$LightlyActiveMinutes\n","t = 9.1661, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.2269361 0.3443464\n","sample estimates:\n","      cor \n","0.2867175 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$FairlyActiveMinutes\n","t = 9.5479, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.238215 0.354813\n","sample estimates:\n","      cor \n","0.2976235 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$VeryActiveMinutes\n","t = 23.939, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.5745197 0.6540260\n","sample estimates:\n","      cor \n","0.6158383 \n"]},"metadata":{},"output_type":"display_data"}],"source":["cor.test(activity$Calories,activity$SedentaryMinutes, method=\"pearson\")\n","cor.test(activity$Calories,activity$LightlyActiveMinutes, method=\"pearson\")\n","cor.test(activity$Calories,activity$FairlyActiveMinutes, method=\"pearson\")\n","cor.test(activity$Calories,activity$VeryActiveMinutes, method=\"pearson\")"]},{"cell_type":"markdown","id":"0ed98164","metadata":{"papermill":{"duration":0.425823,"end_time":"2022-03-08T01:36:30.776927","exception":false,"start_time":"2022-03-08T01:36:30.351104","status":"completed"},"tags":[]},"source":["**From the above result, we can interpret:**\n","* Very Active Minutes: The p-value <2.2e-16, which is less than significance level(0.05). VeryActive Minutes and Calories are statically significant with moderately positive correlation(correlation coefficient=0.61). \n","\n","* Fairly Active Minutes: The p-value <2.2e-16, which is less than significance level. Fairly Active Minutes and Calories are statically significant with low positive correlation(0.29).\n","\n","* Lightly Active Minutes: The p-value <2.2e-16, which is less than significance level. LightlyActiveMinutes and Calories are statically significant with positive correlation(0.28).\n","\n","* SedentaryMinutes: The p-value = 0.001021, which is less than significance level. SedentaryMinutes and Calories are statically significant with negative correlation(-0.106)."]},{"cell_type":"markdown","id":"cc3b20cb","metadata":{"papermill":{"duration":0.416051,"end_time":"2022-03-08T01:36:31.614763","exception":false,"start_time":"2022-03-08T01:36:31.198712","status":"completed"},"tags":[]},"source":["#### **V.2.c. Calories burned during different active distance:** <a id=\"cd\"></a>"]},{"cell_type":"code","e