","metadata":{"papermill":{"duration":0.467946,"end_time":"2022-03-08T01:36:35.249689","exception":false,"start_time":"2022-03-08T01:36:34.781743","status":"completed"},"tags":[]},"source":["* The graph shows a positive linear correlation between the VeryActive Distance/ModeratelyActive Distance/LightlyActive Distance and calories burned. But there is no correlation between Sedentary Active Distance and calories burned. Will use Pearson coefficient correlation to determine how strong these variables are related."]},{"cell_type":"markdown","id":"7fce903b","metadata":{"papermill":{"duration":0.436811,"end_time":"2022-03-08T01:36:36.149161","exception":false,"start_time":"2022-03-08T01:36:35.71235","status":"completed"},"tags":[]},"source":["* #### **Correlation test between Active Distance and Calories burned:**"]},{"cell_type":"code","execution_count":18,"id":"24b2f9ec","metadata":{"execution":{"iopub.execute_input":"2022-03-08T01:36:37.055819Z","iopub.status.busy":"2022-03-08T01:36:37.053578Z","iopub.status.idle":"2022-03-08T01:36:37.095136Z","shell.execute_reply":"2022-03-08T01:36:37.093454Z"},"papermill":{"duration":0.512554,"end_time":"2022-03-08T01:36:37.095301","exception":false,"start_time":"2022-03-08T01:36:36.582747","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$SedentaryActiveDistance\n","t = 1.3382, df = 938, p-value = 0.1812\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," -0.02034679  0.10729427\n","sample estimates:\n","       cor \n","0.04365187 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$LightActiveDistance\n","t = 16.171, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.4153762 0.5154690\n","sample estimates:\n","      cor \n","0.4669168 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$ModeratelyActiveDistance\n","t = 6.8013, df = 938, p-value = 1.844e-11\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.1549966 0.2768935\n","sample estimates:\n","      cor \n","0.2167899 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  activity$Calories and activity$VeryActiveDistance\n","t = 17.306, df = 938, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.4419180 0.5389469\n","sample estimates:\n","      cor \n","0.4919586 \n"]},"metadata":{},"output_type":"display_data"}],"source":["cor.test(activity$Calories,activity$SedentaryActiveDistance, method=\"pearson\")\n","cor.test(activity$Calories,activity$LightActiveDistance, method=\"pearson\")\n","cor.test(activity$Calories,activity$ModeratelyActiveDistance, method=\"pearson\")\n","cor.test(activity$Calories,activity$VeryActiveDistance, method=\"pearson\")"]},{"cell_type":"markdown","id":"713ad4ae","metadata":{"papermill":{"duration":0.446321,"end_time":"2022-03-08T01:36:37.983448","exception":false,"start_time":"2022-03-08T01:36:37.537127","status":"completed"},"tags":[]},"source":["**From the above result, we can interpret:**\n","* Very Active Distance: The p-value <2.2e-16, which is less than significance level(0.05). VeryActive Distance and Calories are statically significant with low positive correlation(correlation coefficient=0.49). \n","\n","* Moderately Active Distance: The p-value = 1.844e-11, which is less than significance level. Moderately Active Distance and Calories burned have marginally low positive correlation(correlation coefficient=0.21). This may be due to, too 