diture: METs Vs. Steps Taken** <a id=\"eems\"></a>\n","A [MET](https://www.hsph.harvard.edu/nutritionsource/staying-active/)(metabolic equivalent of task) is a ratio of your working metabolic rate relative to your resting metabolic rate. Metabolic rate is the rate of energy expended per unit of time. It’s one way to describe the intensity of an exercise or activity.\n","\n","* Resting—Uses 1.5 or fewer METs. Examples are sitting, reclining, or lying down.\n","* Light intensity—Uses from 1.6-3.0 METs. Examples are walking at a leisurely pace or standing in line at the store.\n","* Moderate intensity—Uses from 3.0-6.0 METs. Examples are walking briskly, vacuuming, or raking leaves.\n","* Vigorous intensity—Uses from 6.0+ METs.\n","\n","Fitbit API returns MET values without a decimal point. So divide METs by 10 before analysis. [More Info](http://community.fitbit.com/t5/Web-API-Development/Definition-of-Mets-in-Charge-HR/td-p/1240824)"]},{"cell_type":"code","execution_count":26,"id":"0dc5a399","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-03-08T01:36:56.41648Z","iopub.status.busy":"2022-03-08T01:36:56.414998Z","iopub.status.idle":"2022-03-08T01:38:25.141967Z","shell.execute_reply":"2022-03-08T01:38:25.142472Z"},"papermill":{"duration":89.207614,"end_time":"2022-03-08T01:38:25.142665","exception":false,"start_time":"2022-03-08T01:36:55.935051","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 3 × 5</caption>\n","<thead>\n","\t<tr><th scope=col>Id</th><th scope=col>date</th><th scope=col>day</th><th scope=col>METs</th><th scope=col>mets</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dttm&gt;</th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>1503960366</td><td>2016-04-12 00:00:00</td><td>Tuesday</td><td>10</td><td>1</td></tr>\n","\t<tr><td>1503960366</td><td>2016-04-1