{"papermill":{"duration":0.503431,"end_time":"2022-03-08T01:45:24.387684","exception":false,"start_time":"2022-03-08T01:45:23.884253","status":"completed"},"tags":[]},"source":["**From the above graph, we can interpret,**\n","* Vigorous: \n","Most of the step count values are distributed around the sample median just over 100 . The participants involved in higher MET activities on  Monday,Tuesday and Thursday. \n","Throughout the week the distribution is negatively skewed indicates few Vigorous intense activities.\n","\n","* Moderate:\n","Most of the step count values are distributed at first quartile, all days of the week. Throughout the week the distribution is looks similar and elongated. The mean is slightly lower than the median, indicates few low step counts values for moderately intense activities.  \n","\n","* Light:\n","Throughout the week the distribution is looks similar. The mean is same as the median, indicates a symmetrical distribution of step counts. So few participants involved in  light intense activities . Shows two modes of the bimodal data set for all days. \n","\n","* Resting:\n","The step count values are between 0-2. Few participants were mostly sedentary. On thursday, there is few low activity distribution.Two modes of the bimodal dataset on Tuesday, Wednesday and weekends."]},{"cell_type":"markdown","id":"1a3ce600","metadata":{"papermill":{"duration":0.500486,"end_time":"2022-03-08T01:45:25.412789","exception":false,"start_time":"2022-03-08T01:45:24.912303","status":"completed"},"tags":[]},"source":["#### **V.2.h. Overall Analysis: Step count Vs METs Vs. Intensity LevelsVs. Calories** <a id=\"ovs\"></a>\n","To compare the calorie burn changes with distance travelled,METs and intensity levels on each day"]},{"cell_type":"code","execution_count":30,"id":"a141aabe","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-03-08T01:45:26.422386Z","iopub.status.busy":"2022-03-08T01:45:26.420301Z","iopub.status.idle":"2022-03-08